//import logo from './logo.svg';
import "./App.css";

import React, { Component } from "react";
import NavBar from "./components/NavBar";
import News from "./components/News";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

export default class App extends Component {
  render() {
    return (
      <div>
        <>
          <Router>
            <NavBar />
            {/* <News pageSize={6} country="in" category="sports" /> */}

            <Routes>
              <Route
                path="/"
                element={<News pageSize={9} country="in" category="general" />}
              ></Route>
              <Route
                exact
                path="/business"
                element={
                  <News
                    key="business"
                    pageSize={9}
                    country="in"
                    category="business"
                    src={
                      !imageUrl
                        ? "https://images.moneycontrol.com/static-mcnews/2020/07/rupee-653x435.jpg"
                        : imageUrl
                    }
                  />
                }
              ></Route>
              <Route
                exact
                path="/entertainment"
                element={
                  <News
                    key="entertainment"
                    pageSize={9}
                    country="in"
                    category="entertainment"
                  />
                }
              ></Route>
              <Route
                exact
                path="/science"
                element={
                  <News
                    key="science"
                    pageSize={9}
                    country="in"
                    category="science"
                  />
                }
              ></Route>
              <Route
                exact
                path="/sports"
                element={
                  <News
                    key="sports"
                    pageSize={9}
                    country="in"
                    category="sports"
                  />
                }
              ></Route>
              <Route
                exact
                path="/technology"
                element={
                  <News
                    key="technology"
                    pageSize={9}
                    country="in"
                    category="technology"
                  />
                }
              ></Route>
              <Route
                exact
                path="/health"
                element={
                  <News
                    key="health"
                    pageSize={9}
                    country="in"
                    category="health"
                  />
                }
              ></Route>
            </Routes>
          </Router>
        </>
      </div>
    );
  }
}
